import React, { Component } from 'react';
import firebase from './FirebaseConfig';
class Test extends Component {
    constructor(props){
        super(props);
        this.x =firebase.database().ref("list");
    }
    setDB(){
        this.x.set({
            React:"khai ginag"
        })
    }
    render() {

        return (
            <div>
                <button onChange={()=>{this.setDB()}}>SetDB</button>
            </div>
        );
    }
}

export default Test;
